import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


/**
 * 
 */
const footerMain = {
    backgroundColor: "#02FFFF",
    padding: "3em",
    color: "white",
    position: "absolute",
    width: "100%",
    bottom: "0"
}

const Footer = () => {
    return <footer style={footerMain}>

        <i className="material-icons" style={{ fontSize: '36px' }}>share</i>
    </footer>;
}


// #endregion

export default Footer;
